import 'dart:convert';

import 'package:ainsighter/data/model/response/user_model.dart';

class ClassifiedModel {
  int id;
  String title;
  String description;
  List<dynamic> images;
  dynamic price;
  UserModel user;
  String createdAt;
  String updatedAt;
  int squareMeter;
  int blockNo;
  int lotNo;
  int zoningStatus;
  int landStatus;
  int usageStatusId;
  int categoryId;
  int neighborhoodId;
  int cityId;
  int districtId;
  int commissionPercentage;
  String category;
  String city;
  String district;
  String neighborhood;
  int visitCount;
  int classifiedStatus;
  bool isFaved;
  bool featured;

  ClassifiedModel(
      {this.id,
      this.title,
      this.description,
      this.images,
      this.price,
      this.user,
      this.createdAt,
      this.updatedAt,
      this.squareMeter,
      this.blockNo,
      this.lotNo,
      this.zoningStatus,
      this.landStatus,
      this.usageStatusId,
      this.categoryId,
      this.neighborhoodId,
      this.cityId,
      this.districtId,
      this.commissionPercentage,
      this.category,
      this.city,
      this.district,
      this.neighborhood,
      this.visitCount,
      this.classifiedStatus,
      this.isFaved,
      this.featured});

  ClassifiedModel.fromJson(Map<String, dynamic> json) {
    id = json['id'];
    title = json['title'];
    description = json['description'];
    images = jsonDecode(json['images']) ?? [];
    price = json['price'];
    if (json['user'] != null) {
      user = UserModel.fromJson(json['user']);
    }
    createdAt = json['created_at'];
    updatedAt = json['updated_at'];
    squareMeter = json['square_meter'];
    blockNo = json['block_no'];
    lotNo = json['lot_no'];
    zoningStatus = json['zoning_status'];
    landStatus = json['land_status'];
    usageStatusId = json['usage_status_id'];
    categoryId = json['category_id'];
    neighborhoodId = json['neighborhood_id'];
    cityId = json['city_id'];
    districtId = json['district_id'];
    commissionPercentage = json['commission_percentage'];
    category = json['category'];
    city = json['city'];
    district = json['district'];
    neighborhood = json['neighborhood'];
    visitCount = json['visit_count'];
    classifiedStatus = json['status'];
    isFaved = json['is_faved'];
    featured = json['featured'] == 1 ? true : false;
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = new Map<String, dynamic>();
    data['id'] = this.id;
    data['title'] = this.title;
    data['description'] = this.description;
    data['images'] = this.images;
    data['price'] = this.price;
    data['user'] = this.user;
    data['created_at'] = this.createdAt;
    data['updated_at'] = this.updatedAt;
    data['square_meter'] = this.squareMeter;
    data['block_no'] = this.blockNo;
    data['lot_no'] = this.lotNo;
    data['zoning_status'] = this.zoningStatus;
    data['land_status'] = this.landStatus;
    data['usage_status_id'] = this.usageStatusId;
    data['category_id'] = this.categoryId;
    data['neighborhood_id'] = this.neighborhoodId;
    data['city_id'] = this.cityId;
    data['district_id'] = this.districtId;
    data['commission_percentage'] = this.commissionPercentage;
    data['category'] = this.category;
    data['city'] = this.city;
    data['district'] = this.district;
    data['neighborhood'] = this.neighborhood;
    data['visit_count'] = this.visitCount;
    data['status'] = this.classifiedStatus;
    data['is_faved'] = this.isFaved;
    data['featured'] = this.featured;
    return data;
  }
}
